webpackJsonp([0xd53f2ab8b2cf],{484:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Turfa's Blog",author:"Turfa Auliarachman"}},markdownRemark:{id:"/Users/mac/Documents/Coding/gatsby-blog/src/pages/last-day-in-vanitee/index.md absPath of file >>> MarkdownRemark",html:'<p>Today is my last day having an internship at <a href="https://www.vanitee.com">Vanitee</a>\nin Singapore. I didn’t have any task left since the afternoon. That proud\nmoment when you can say, “I don’t have anything to do.” in the daily stand up\nlol.</p>\n<p>Recognizing my <em>gabutness</em>, I planned to execute one thing from my to-do\nlist: migrating this blog to <a href="https://www.gatsbyjs.org/">Gatsbyjs</a>.</p>\n<p>I did some research to decide which starter kit I should use. And in the end,\nI choose <a href="https://github.com/gatsbyjs/gatsby-starter-blog">Gatsby Starter Blog</a>.\nHaha. Simple is better.</p>\n<p>And… here we go.</p>\n<p>Hope I can be more productive in writing after this. (Actually I’m being\npessimistic about it. Just see the date of the other posts. :(  )</p>',frontmatter:{title:"Last Day in Vanitee, Migrate Blog",date:"12 January 2018"}}},pathContext:{slug:"/last-day-in-vanitee/",previous:{fields:{slug:"/machine-learning/"},frontmatter:{title:"Machine Learning, Ilmu yang Terdengar Sangat Seksi"}},next:!1}}}});
